import React from "react";
import sdata from './'

const Amazon = () => {
  return (
    <Card
      key={sdata[3].id}
      name={sdata[3].name}
      imgsrc={sdata[3].imgsrc}
      title={sdata[3].title}
      link={sdata[3].link}
    />
  );
};
export default Amazon;
